import React from "react";
import './Home.css'

function AddPost(){
    return(
        <>
            <div class="a">
            <h1>Thêm bài viết</h1>
            </div>

            <form action="addPost" method="post">
            <textarea className="text" rows = "5" cols = "80" name="content" id="content" type="text" placeholder="Nhập nội dung bài viết"></textarea>
            <button className="button" type="submit">Thêm bài viết</button>
            </form>
        </>
    )
}

export default AddPost;
